import './Diploma.css';
import eda from '../../images/eda.JPG';

export default function Diploma () {
  return (
    <section className='diploma'>
      <div className="diploma__content">
        <div className="diploma_docs">
          <h2 className='diploma__heading'>Мои дипломы</h2>
            <ul>
              <li className='diploma__photo'>
                <img src={eda} alt="медицинсоке образование" />
              </li>
              <li className='diploma__photo'>
                <img src={eda} alt="курс нутрициолога" />
              </li>
            </ul>
        </div>
      </div>
    </section>
  )
};
